import React from 'react';

const Contact = () => {
  return (
    <section className="contact" id="contact">
      <h2>Contact Us</h2>
      <p>Email: info@ujuzivijana.com</p>
      <p>Phone: +123 456 789</p>
    </section>
  );
};

export default Contact;
